import React, {useState} from 'react';
import {View, TouchableHighlight, Image, StyleSheet, Alert, ActionSheetIOS, Linking, ImageBackground} from 'react-native';

export const placeholder = "data:image/jpeg;base64,";

export default function RNImage(props) {
    let {showImagePicker, onImageSelected} = props;
    let {containerStyle,} = props;

    //1 - DECLARE VARIABLES
    const [image, setImage] = useState(null);
    let size = props.size - (props.borderWidth * 2);
    let imageProps = {width: size, height: size};

    async function onSelectPhoto() {
        const result = await showImagePicker();

        if (result.hasOwnProperty('cancelled') && result.cancelled) alert("User Cancelled");
        else if (result.hasOwnProperty('uri')) await handleImagePicked(result);
        else if (result.hasOwnProperty('error')) {
            Alert.alert("Error Occurred", "Something went wrong. please try again.",
                [{text: 'Cancel', style: 'cancel'}],
                {cancelable: false}
            );
        }
    }

    //HANDLE IMAGE PICKER
    async function handleImagePicked(result) {
        try {
            if (!result.cancelled) {
                const name = '_' + Math.random().toString(36).substr(2, 9);
                let image = {uri: result.uri, type: 'image/jpeg', name: name + '.jpg'};
                setImage(image);
                onImageSelected(image);
            }
        } catch (e) {
            alert('Upload failed, sorry :(');
        }
    }

    return (
        <View style={[styles.container, containerStyle]}>
            <TouchableHighlight style={[{flex:1}]} onPress={onSelectPhoto} underlayColor="rgba(0, 0, 0, 0)">
                <ImageBackground style={[styles.avatarWrapper]}
                                 source={{uri: (!image && !props.image) ? props.placeholder : (props.image) ? props.image : image.uri, ...imageProps}}>
                </ImageBackground>
            </TouchableHighlight>
        </View>
    )
};

RNImage.defaultProps = {
    image: null,
    containerStyle: {},
    bundleIdentifier: "expo",
    placeholder: placeholder,
    getPermission:null,
    showImagePicker:null,
    onImageSelected: () => alert("onImageSelected not set"),
};

let center = {
    justifyContent: "center",
    alignItems: "center",
};

const styles = StyleSheet.create({
    container: {
        height: 200,
        flex:1
    },

    avatarWrapper: {
        backgroundColor: "#e7e7e7",
        flex:1
    }
});